import React, { useState } from 'react';
import Header from './components/Header';
import Timer from './components/Timer';
import Tasks from './components/Tasks';
import Footer from './components/Footer';
import Soundscapes from './components/Soundscapes';
import Profile from './components/Profile';
import Metrics from './components/Metrics';

function App() {
  const [defaultFocusSettings, setDefaultFocusSettings] = useState([]);
  const [metrics, setMetrics] = useState({
    completedTasks: 0,
    totalFocusTime: 0,
    totalBreaks: 0,
  });

  return (
    <div className="app-container bg-gradient-to-r from-purple-500 via-blue-500 to-indigo-600 min-h-screen text-white flex flex-col">
      <Header />
      <main className="p-6 flex-1 flex flex-col items-center">
        <Profile
          defaultFocusSettings={defaultFocusSettings}
          setDefaultFocusSettings={setDefaultFocusSettings}
        />
        <Timer metrics={metrics} setMetrics={setMetrics} />
        <Soundscapes />
        <Tasks />
        <Metrics metrics={metrics} />
      </main>
      <Footer />
    </div>
  );
}

export default App;
